import { BiSearch } from "react-icons/bi";
import Select from 'react-select'

const Search = () => {

  const options = [
    { value: 'chocolate', label: 'Chocolate' },
    { value: 'strawberry', label: 'Strawberry' },
    { value: 'vanilla', label: 'Vanilla' }
  ]

  return (
    <div className="w-full bg-white flex items-center justify-between mt-[45px] p-4">
      <div className="w-2/3 flex items-center relative">
        <BiSearch className="absolute top-1/2 -translate-y-1/2 right-3 text-slate-400 text-2xl" />
        <input className="bg-zinc-800 py-4 pr-10 text-sm rounded-full outline-none text-white w-full" type={"text"} placeholder="search..." />
      </div>
      <div className="w-1/3 flex items-center mr-1">
        <Select options={options} />
      </div>
    </div>
  );
}

export default Search;
